INSERT INTO `catalogue_pages` VALUES ('1', '1', 'Frontpage', 'Frontpage', 'ctlg_frontpage2', 'catal_fp_header', 'catal_fp_pic4,catal_fp_pic5,', 'Need some Furni for your Habbo room?  Well, you’re in the right place!  This Catalogue is packed FULL of funky Furni, just click the tabs on the right to browse.<br>We regularly add and remove Furni, so check back regularly for new items.<br>\r\nHei, and welcome to the Catalogue of this brand new Holograph Emulator!<br>If you are an Administrator, you are able to edit everything in the catalogue, including the items, to your own whishes!<br>If you aren\'t an Administrator, then you haven\'t seen this text and you just go enjoy the furniture heh!', null, null, null);
INSERT INTO `catalogue_pages` VALUES ('2', '1', 'Plants', 'Plants', 'ctlg_layout2', 'catalog_plants_headline1', 'catalog_plants_teaser1,', 'Introducing the Plant Collection...  Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality!<br>Green ftw!', 's:2: I am supposed to be a tree?!', 'Click on the item you want for more information', null);
INSERT INTO `catalogue_pages` VALUES ('3', '6', 'Staffitems', 'Staff stuff! :)', 'ctlg_layout2', 'catalog_rares_headline1', 'catalog_gothic_teaser1,', 'Hey if you have reached here, and you aren\'t a Moderator/Administrator, then you are more leet than I thought.<br>This page is for Staff only, so if you aren\'t leet then gtfo. =]', null, 'Click on a cool thing and it\'s yours', null);
INSERT INTO `catalogue_pages` VALUES ('4', '1', 'Clubfurni', 'Club Furni', 'ctlg_layout2', 'catalog_rares_headline1', 'catalog_plants_teaser1,', 'Umm yeah here are some Club furnitures, edit this page + the others to your whishes in the database. =]', null, 'Click on the item you want for more information', null);
INSERT INTO `catalogue_pages` VALUES ('5', '1', 'Spaces', 'Spaces', 'ctlg_spaces', 'catalog_spaces_headline1', null, 'Are your walls looking a little grey?  What you need is a splash of paint and this is the place to get it!  <br><br>A splash of colour on the walls and a nice carpet can make all the difference. Use our virtual room below to test out the combinations before you buy. ', 't1:Wall\r\nt2:Floor\r\nt3:Pattern\r\nt4:Colour\r\nt5:Pattern\r\nt6:Colour\r\nt7:Preview', null, null);
