INSERT INTO `cms_posts` VALUES ('115', '1', '25', 'Meth0d', '17-02-2008 08:23:08', 'The badge system in HoloCMS is no longer static with only ADM and HC1, it fetches your badge and badge status (show, hide) from the user table, checks if you actually own that badge, and if everything\\\'s OK, it shows that badge.\r\n\r\nAn example is the badge next to me -- XM8. It works in HoloCMS, and should work fine in Holograph, too.\r\n\r\nThe badges are fetched from the Habbo.co.uk badge album -- with transperancy.', '17-02-2008 13:45:58', 'Meth0d');
